                value={fecha_entrada_1_update}
              />
            </Grid>
            <Grid item xs={2}>
              <TextField
                onChange={(e) => setFecha_entrada_2_update(e.target.value)}
                fullWidth
                value={fehca_entrada_2_update}
                type="date"
                InputProps={{
                  startAdornment: (
                    <InputAdornment position="start">(2)</InputAdornment>
