                }}
              />
            </Grid>
            <Grid item xs={2}>
              <TextField
                onChange={(e) => setFecha_entrada_3_update(e.target.value)}
                fullWidth
                type="date"
                value={fecha_entrada_3_update}
                InputProps={{
                  startAdornment: (
                    <InputAdornment position="start">(3)</InputAdornment>
