                }}
              />
            </Grid>
            <Grid item xs={2}>
              <TextField
                onChange={(e) => setFecha_entrada_4_update(e.target.value)}
                type="date"
                fullWidth
                value={fecha_entrada_4_update}
                InputProps={{
                  startAdornment: (
                    <InputAdornment position="start">(4)</InputAdornment>
                  ),
                }}
              />
            </Grid>
            <Grid item xs={2}>
