                    {tipo_expediente.nombre}
                  </MenuItem>
                ))}
              </Select>
            </Grid>
            <Grid
              justifyContent="right"
              display="flex"
              alignItems="center"
              item
              xs={1}
            >
              <InputLabel>Titular:</InputLabel>
