                {Array.from(
                  { length: new Date().getFullYear() - 1950 },
                  (_, index) => index + 1970
                ).map((anyo) => (
                  <MenuItem divider key={anyo} value={anyo}>
                    {anyo}
                  </MenuItem>
                ))}
              </Select>
            </Grid>
            <Grid
              justifyContent="right"
              display="flex"
              alignItems="center"
              item
              xs={1}
            >
              <InputLabel>Asunto:</InputLabel>
            </Grid>
            <Grid item xs={7}>
              <Select
                error={tipo_asunto_update === ""}
                onChange={function (e) {
                  console.log(tipo_asunto_update);
                  console.log(e.target.value);
                  setTipo_asunto_update(e.target.value);
                }}
                fullWidth
                value={tipo_asunto_update}
              >
                {tipo_asunto.map((tipo_asunto) => (
                  <MenuItem divider key={tipo_asunto.id} value={tipo_asunto.id}>
                    {tipo_asunto.nombre}
                  </MenuItem>
                ))}
              </Select>
            </Grid>
            <Grid
              justifyContent="right"
              display="flex"
              alignItems="center"
              item
              xs={1}
            >
              <InputLabel>Expediente:</InputLabel>
            </Grid>
            <Grid item xs={3}>
              <TextField
                fullWidth
                value={expediente_t_update}
                onChange={(e) => setExpediente_t_update(e.target.value)}
              />
            </Grid>
            <Grid
              justifyContent="right"
              display="flex"
              alignItems="center"
              item
              xs={1}
            >
              <InputLabel>Observaciones:</InputLabel>
            </Grid>
            <Grid item xs={7}>
              <TextField
                fullWidth
                value={observaciones_update}
                onChange={(e) => setObservaciones_update(e.target.value)}
              />
            </Grid>
          </Grid>
        </DialogContent>
        <DialogActions>
          <Button onClick={handleClose}>Cancelar</Button>
          <Button onClick={(e) => updateExpediente()} color="primary">
            Actualizar
          </Button>
        </DialogActions>
      </Dialog>
    );
  };

  return (
    <DashboardLayout>
