                            />
                          </Grid>

                          <Grid item xs={2.5}>
                            <TextField
                              helperText="Hasta"
                              fullWidth
                              type="date"
                              value={fecha_entrada_final}
                              onChange={(e) =>
                                setFecha_entrada_final(e.target.value)
                              }
                            />
                          </Grid>
                          <Grid
                            justifyContent="right"
                            display="flex"
                            alignItems="center"
