                          <Grid item xs={2.5}>
                            <TextField
                              helperText="Desde"
                              fullWidth
                              type="date"
                              value={fecha_salida_inicial}
                              onChange={(e) =>
                                setFecha_salida_inicial(e.target.value)
                              }
                            />
                          </Grid>

                          <Grid item xs={2.5}>
                            <TextField
                              helperText="Hasta"
                              fullWidth
                              type="date"
                              value={fecha_salida_final}
                              onChange={(e) =>
                                setFecha_salida_final(e.target.value)
                              }
                            />
                          </Grid>
                          <Grid
                            justifyContent="right"
                            display="flex"
                            alignItems="center"
                            item
                            xs={1}
                          >
                            <InputLabel>Tipo expediente:</InputLabel>
                          </Grid>
                          <Grid item xs={4}>
                            <Select
                              error={tipo_expediente === ""}
